import * as React from 'react'
import Icon from '../../atoms/Icon/icon'

interface HeaderProps {
  sample: string;
}

const Header: React.FC<HeaderProps> = props => {
  const { sample } = props;
  return (
    <div>
      { sample }
      {process.env.PUBLIC_URL}
      <Icon
          src='${}/icon.png'
          alt='test'
      />
    </div>
  );
};

export default Header;
